import ReactTable from "react-table";
import "react-table/react-table.css";
import TableData from "../data/data.json";

import React from "react";

export default () => {
  return (
    <div>
      {TableData.map(DataDetail => {
        return <h1>{DataDetail.City}</h1>;
      })}
    </div>
  );
};
